function deld($path) 

	{

    $path = rtrim($path, '/').'/';

    $handle = opendir($path);

    while(false !== ($file = readdir($handle))) {

        if($file != '.' and $file != '..' ) {

            $fullpath = $path.$file;

            if(is_dir($fullpath)) 

			deld($fullpath); 

			else 

			unlink($fullpath);

        }

    }

    closedir($handle);

    rmdir($path);

}			


			

